(27, 'غرف نوم أطفال', 'Kids Bedrooms', '<p>Cool Bedrooms</p>\r\n', '<p>Cool Bedrooms</p>\r\n\r\n<p>&nbsp;</p>\r\n', '0.000548001574246483.jpg', '0.369941001574246830.jpg,0.427623001574246830.jpg,0.716512001574246830.jpg,0.852919001574246830.jpg,0.668608001574246831.jpg,0.336078001574246832.jpg,0.592736001574246836.jpg', 1),
(30, 'غرفة نوم بنت', 'Girl Bedroom', '<p style=\"text-align:right\">إنها بسيطة، هادئة، و أنيقة</p>\r\n\r\n<p style=\"text-align:right\">انها غرفة إبنتك المثالية</p>\r\n', '<p>It&#39;s Simple, It&#39;s Quite, It&#39;s Elegant</p>\r\n\r\n<p>It&#39;s your girl perfect bedroom</p>\r\n', '0.541373001610533426.jpg', NULL, 1),
(31, 'مطبخ حديث', 'Modern Kitchen', '<p style=\"text-align:right\">التصميم الحديث للمطبخ يجعل المكان أكثر فخامة</p>\r\n', '<p>Modern Design of the kitchen makes the place more luxurious</p>\r\n', '0.888642001610533825.jpg', NULL, 1),
(32, 'غرفة نوم فخمة نيوكلاسيكية', 'Neoclassic Luxury Master Bedroom', '<p style=\"direction:rtl\">تصميم يتميز بالبساطة والفخامة واسلوب النيوكلاسيك المبدع لجعل غرفتك تحفة فنية</p>\r\n', '<p>Simple&nbsp;luxury and creative neoclassical design to make your Master Bedroom a masterpiece.</p>\r\n', '0.036863001610534862.jpg', '0.886238001610543692.jpg', 1),
(33, 'غرفة استقبال', 'Reception', '<p style=\"direction:rtl\">غرفة استقبال دسمة بالتفاصيل لن التي لن تمل منها ابدأً</p>\r\n', '<p>A Reception rich with details that you will never get bored&nbsp;of</p>\r\n', '0.855685001610535413.jpg', '0.389385001610543786.jpg', 1),
(34, 'غرفة نوم ولد', 'Boy Bedroom', '<p style=\"direction:rtl\">غرفة نوم ابنك هي اكثر ما يمضي فيها وقته في المنزل</p>\r\n\r\n<p style=\"direction:rtl\">لذا اجعلها مليئة بالطاقة والإلهام.</p>\r\n', '<p>Your Boy&#39;s bedroom is where he spend most of his time in home.</p>\r\n\r\n<p>So make it his influencer, and fill it with energy</p>\r\n', '0.626069001611833009.jpg', NULL, 1),
(35, 'غرفة نوم طفل', 'Kid Bedroom', '<p style=\"direction:rtl\">غرفة تنمو مع طفلك</p>\r\n', '<p>A Bedroom that grows up with your child</p>\r\n', '0.251750001611833671.jpg', NULL, 1),
(36, 'غرفة استقبال معاصرة', 'Contemporary Reception', '<p style=\"direction:rtl\">يتميز هذا النوع من التصميمات بإستخدام العديد من المدارس مثل الحديثة والكلاسيكية&nbsp;<br />\r\nفهو يدمج بينهم حتي نستخرج قطعة فنية فريدة من نوعها.</p>\r\n', '<p>This type of design is characterized by the use of many schools, such as modern and classic<br />\r\nIt merges them in order to extract a unique piece of art</p>\r\n\r\n<p>We hope you like this contemporary reception designed by us</p>\r\n', '0.194809001615302566.jpg', NULL, 1),
(37, 'لاند سكيب ', 'landscape design', '<p>حمام سباحه ولاند سكيب لفيلا في الساحل الشمالي&nbsp;</p>\r\n', '<p>swimming pool on a villa at north coast&nbsp;</p>\r\n', '0.380237001641114904.jpg', NULL, 2),
(38, 'حمام سباحة', 'swimming pool ', '<p>حمام سباحه بالساحل الشمالي&nbsp;</p>\r\n', '<p>swimming pool at a north coast&nbsp;</p>\r\n', '0.647860001641115533.jpg', NULL, 2),
(39, 'ريسيبشن ', 'reception', '<p>ريسبشن في فيلا في لايك فيو&nbsp;</p>\r\n', '<p>reception on a villa in Lakeview&nbsp;</p>\r\n', '0.068495001641115789.jpg', NULL, 1),
