(42, 'فيلا في ليك فيو ', ' Villa in Lakeview ', '<p>تصميم خارجي لفيلا ب ليك فيو&nbsp;</p>\r\n', '<p>exterior design for a villa at lake view&nbsp;</p>\r\n', '0.506943001641117678.jpg', NULL, 2),
