INSERT INTO `services` (`id`, `name_ar`, `name_en`, `desc_ar`, `desc_en`, `img`) VALUES
(25, 'خدمات المقاولات', 'Contracting service', '<pre style=\"text-align:right\">\r\n<span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:11px\">لديك خطط وجاهزة للبناء؟ نحن نعد عروض مفصلة و محددة، ونساعدك على المقارنة\r\n  تحت اشراف مهندس القيمة اذا تطلب الامر. نحن نفهم قيمة التصميم ونوفر ذلك في كل مشروع بناء علي متطلبات العملاء و اهدافهم\r\nنحن لا نقطع الزوايا ونقدم أسعارًا شفافة ونضمن أن تكون وظيفتك مبنية في الوقت المحدد و الميزانية المحددة</span></span></pre>\r\n', '<p><span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">have plans and ready to build?we prepare detailed,itemized bids,help you to compare apples-to-apples,and value engineer if need be.we understand the value of design and bring this to every construction project.<br />\r\nwe don&#39;t cut corners,provide transparent pricing and ensure that your job is built on time and on budget</span></span></p>\r\n', '0.528975001717943730.png'),
(26, 'الاثاث', 'Furniture', '<div dir=\"rtl\">\r\n<pre>\r\n<span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">نحن لا نؤمن بأثاث واحد يناسب الجميع\r\nلم نكن نصدق مدى صعوبة العثور على أثاث عالي الجودة\r\nقابلة للتخصيص لتناسب أسلوبك ومساحتك.\r\nلذلك أنشأنا طريقة أفضل للتسوق لشخص واحد.\r\nتضعك تجربة الأثاث القابلة للتخصيص لدينا في مقعد المصمم - وليس العكس. والآن ، قمنا بتوسيع أسلوبنا في استخدام الطاولات والسجاد والإضاءة</span></span></pre>\r\n</div>\r\n', '<p><span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">we don&rsquo;t believe in one furniture fits all<br />\r\nWe couldn&rsquo;t believe how challenging it was to find a high-quality furniture that&rsquo;s<br />\r\ncustomizable to fit your style and space.&nbsp;<br />\r\nSo we created a better way to shop for one.</span></span><br />\r\n<span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">Our customizable furniture experience puts you in the designer&rsquo;s seat&mdash;not the other way around. And now, we&rsquo;ve expanded our approach to tables, rugs, and lighting</span></span></p>\r\n', '0.574719001717943780.png'),
(27, 'اعمال التنفيذ', 'Fine Finishing works', '<p dir=\"rtl\"><span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">كي تكتمل الصوره المبدعه التي نقوم بخلقها في &quot;جدار&quot; فإننا نقدم لك جودة تشطيبات داخليه وخارجيه بقدر عالي&nbsp; من الجودة والإبداع بما يتناسب مع احتياجات العميل و&nbsp; العوامل الأساسية المساحات و الهيكل العام للوحدة و الديكورات جميعا مثل ديكور غرف النوم و ديكورات غرف الأطفال و الريسبشن و المكتب.</span></span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">&quot;جدار &quot; أيضا تقدم خدمات متخصصه بـ أعمال التأسيسات بأنواعها و جميع بنود التشطيبات ( أرضيات - طلاء- سقف.. إلخ) بالإضافة إلى أعمال الديكورات (اخشاب - زجاج - رخام ..إلخ ).</span></span></p>\r\n', '<p dir=\"ltr\"><span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">to complete the creative image that we create in &ldquo;Jedar&rdquo;, we offer you the quality of interior and exterior finishes of the same high quality and creativity in proportion to the customer&rsquo;s needs and the basic factors, the spaces, and the general structure of the unit.<br />\r\nJidar provides services specialized in all kinds of foundation works and all the decorations, such as the bedroom decor, the children&#39;s room decorations, the reception, and the office.<br />\r\nand all finishing items (floors - paint - ceilings...etc) in addition to decoration works (wood - glass - marble...etc).</span></span></p>\r\n', '0.382021001717944156.png'),
(29, 'التصميم الخارجي و التصميم الداخلي', 'Exterior and Interior Design', '<div dir=\"rtl\">\r\n<p dir=\"rtl\"><span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">طالما كانت التصميمات هي الطريقة التي نعبر بها عن هوية عملاؤنا بكل تناقضاتها واختلافاتها بفروق دقيقة عن بعض&nbsp;</span></span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">و لإيماننا العميق بأن جوهر التصميم الداخلي دائما ما يتمركز حول الأشخاص وكيف يعيشون بطريقتهم الخاصة&nbsp;</span></span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">الامر ليس مجرد اتباع لموضه او لما هو جديد بقدر ماهو تعبير شخصي عن الأذواق المتعددة&nbsp;</span></span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">لذا فإن المهمة ليست سطحية او سهله.</span></span></p>\r\n</div>\r\n\r\n<div style=\"text-align:right\">&nbsp;</div>\r\n', '<p dir=\"ltr\"><span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">Designs have always been the way we express the identity of our customers with all its contradictions and differences from each other.<br />\r\nFor our deep belief that the core of the interior design is always centered around people and how they live in their way<br />\r\nIt is not just about keeping up with fashion or what is new, as it is a personal expression of various tastes so it&#39;s not superficial or easy</span></span></p>\r\n', '0.094046001717944316.png'),
(30, 'فن الهنسة المعمارية', 'Architecture Art', '<pre style=\"text-align:right\">\r\n<span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">نتعقب بلا كلل أحدث تقنيات التصميم الدولية ونؤيد مفهوم التصميم للتكامل المثالي للإبداع والتكنولوجيا ، ونسعى إلى التصميم المبتكر للتجربة والتكامل</span></span></pre>\r\n', '<p dir=\"ltr\"><span style=\"font-size:11px\"><span style=\"font-family:Comic Sans MS,cursive\">We unremittingly track the latest international design technology and uphold the design concept of the perfect integration of creativity and technology, and pursue innovative design of experience and integration.</span></span></p>\r\n', '0.154799001717944633.png');
