INSERT INTO `website_data` (`id`, `about_en`, `about_ar`, `about_image`, `address_en`, `address_ar`, `phone_number`, `email`, `facebook`, `twitter`, `youtube`, `insta`, `map_lat`, `map_lng`) VALUES
(1, '<p dir=\"ltr\"><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">Our story</span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">In 2017, Jidar for ARCHITECTURE &amp; INTERIOR DESIGN Company was founded by Eng. Wael Abdel Razek. He has great experience in several diverse projects (hospitals - hotels - banks - factories and residential units) and works in the field of architecture and has great experience and a long history in the world of Architecture and designing of construction.</span></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">This makes JIDAR&#39;S&nbsp; history far exceed its actual age, which adds a constant cornerstone to confront and keep up with what is happening in the world of design in terms of rapid developments.&nbsp;</span></span></p>\r\n', '<p dir=\"rtl\"><span style=\"font-size:14px\"><span style=\"font-family:Courier New,Courier,monospace\">قصتنا</span></span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\"><span style=\"font-family:Courier New,Courier,monospace\">أنه في&nbsp; عام 2017&nbsp; تأسست شركة جدار للتصميمات الداخلية والبناء بواسطة المهندس وائل عبد الرازق محمد وأن لديه خبرة كبيرة في مشاريع متعددة (مستشفيات - فنادق - بنوك - مصانع ووحدات سكنية) و يعمل في مجال الهندسة المعمارية و لديه خبرة عظيمة و تاريخ طويل في عالم التصميم والتشييد البنائي.</span></span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px\"><span style=\"font-family:Courier New,Courier,monospace\">مما يجعل لـ جدار تاريخ يفوق عمرها الفعلي بكثير مما أضاف حجر أساس ثابت&nbsp; في مواجه ما يحدث في عالم التصميم من تطورات وتغيرات سريعة.</span></span></p>\r\n', '0.723105001718201275.e0e07382-81cd-40c8-9afc-32a83fde5305.jpg', 'District No1  New Cairo ', ' الحي رقم 1 القاهرة الجديدة', '01017262715   -   01113111914', 'info@jidar-ec.com', 'https://www.facebook.com/jidar.ec/', '', '', 'https://www.instagram.com/jidar.ec/', '30.064938035305275', '31.47353194408693');
INSERT INTO `why_us` (`id`, `title_ar`, `title_en`, `desc_ar`, `desc_en`) VALUES
(1, 'المعرفة', 'knowledge', 'تمتد خبرتنا على مجموعة واسعة من أنواع التصاميم المختلفة وتنفيذها بدقة عالية وتلتزم جدار ببناء الحلول الإبداعية والقيمة وتنظيم العلافات بين التصميم والتنفيذ . ', 'JIDAR experience spans a wide array of project types. JIDAR commitment to building creative solutions, value, and relationships organization.\r\n'),
(2, 'الجودة والسلامة', 'Quality and safety', 'الجودة والسلامة هي أساس من نحن. من بين كل ما هو جديد ، ستجد \"جدار\" شيئا واحدًا لم يتغير.', 'Quality and safety are the foundation of who we are. Among all that is new,  JIDAR would find one thing unchanged.'),
(3, 'الراحة', 'Comfort', ' نحن نستمع, نهتم ونعاملك كواحد من عائلتنا أو الاصدقاء .\r\nنحن نأثر على حياة الناس من خلال ترك انطباع دائم في أذهانهم وقلوبهم.', 'We listen, care, and treat you like one of our family or friends.\r\nWe influence lives by leaving a lasting impression on their mind and heart.\r\n'),
(4, 'الابتكار', 'Innovation', 'نحن تخصص التصاميم لتلبية الاحتياجات الخاصة بك بطرق علمية وعملية مع اضافة  اللمسة الفنية التي تتناسب مع احتياجاتك لتناسب جميع الاذواق و التقافات و الاعمار لنصل لبيت احلامك على أرض الواقع .', 'We customize designs to meet your requirements, In scientific and practical ways with artistic touches that make us meet your needs in a way that suits all tastes, cultures, ages, and social groups to reach your dream home\r\nin reality.\r\n\r\n');
